import './styles.css';

const headline = {
    fontSize: "50px",
}

const subheader = {
    fontSize: "25px",
}

export default function Frontpage() {
    return (
        <div className="Body">
            <h1 style={headline}>Front-end developer, biologist</h1>
            <h4 style={subheader}>I design and code awesome stuff, and I love what I do!</h4>
        </div>
    )
}
